import React from "react";
import { ApolloConsumer } from "react-apollo";

const handleSignout = (client) => {
    localStorage.setItem('token', '')
}

const Signout = () => (
  <div>
    <ApolloConsumer>
      {client => {
        return <button onClick={() => handleSignout}>Signout</button>;
      }}
    </ApolloConsumer>
  </div>
);

export default Signout;
